import './App.css';
import React from 'react';
import {ComponentView} from "echarts/types/src/export/api";


function App() {

  return (
    <div className="Kinsky-Frontend">
        <ComponentView>
            {/* eslint-disable-next-line react/jsx-no-undef */}
            <Text> HEllo world </Text>
        </ComponentView>
    </div>
  );
}

export default App;
